import React from 'react';

export const Button = ({ text, href, secondary, primary, gallery }) => {
	return (
		<>
			{primary && (
				<button className="button bg-button text-white hover:opacity-50">
					{text}
				</button>
			)}
			{secondary && (
				<button
					className="button bg-white  text-button hover:opacity-50"
					href={href}
				>
					{text}
				</button>
			)}
		</>
	);
};
